-- setting unique index when deleted is true
ALTER TABLE roles DROP CONSTRAINT IF EXISTS roles_name_deleted_uindex;
ALTER TABLE attachment DROP CONSTRAINT IF EXISTS attachment_path_file_deleted_unique_index;
ALTER TABLE auth_user DROP CONSTRAINT IF EXISTS auth_user_username_deleted_unique_index;
ALTER TABLE region DROP CONSTRAINT IF EXISTS region_name_deleted_unique_index;
ALTER TABLE district DROP CONSTRAINT IF EXISTS district_name_deleted_unique_index;

CREATE UNIQUE INDEX roles_name_deleted_uindex ON roles (name, deleted) WHERE deleted = FALSE;
CREATE UNIQUE INDEX attachment_path_file_deleted_unique_index ON attachment (path_file, deleted) WHERE deleted = FALSE;
CREATE UNIQUE INDEX auth_user_username_deleted_unique_index ON auth_user (username, deleted) WHERE deleted = FALSE;
CREATE UNIQUE INDEX region_name_deleted_unique_index ON region (name, deleted) WHERE deleted = FALSE;
CREATE UNIQUE INDEX district_name_deleted_unique_index ON district (name, deleted) WHERE deleted = FALSE;

